Some call him a hero. Some call him a villain. He's &quot;John Doe: Vigilante&quot; - an ordinary man who decides to take the law into his own hands. Frustrated with a failing legal system that continues to allow violent criminals to go free, John Doe begins exacting justice the only way he knows how - by killing one criminal at a time. Soon he becomes a media sensation and inspires a group of copycat vigilantes, but who is the real John Doe - a pillar of justice or a cold-blooded murderer? You decide.

Director: Kelly Dolen
Writers: Stephen M. Coates (screenplay), Stephen M. Coates (story)
Stars: Jamie Bamber, Daniel Lissing, Lachy Hulme
Genres: Crime | Thriller
Country: Australia
Language: English

